import zlib
import base64

a = zlib.decompress(base64.b64decode('')).decode()

while True:
    try:
        b = a.replace("import zlib, base64;exec(zlib.decompress(base64.b64decode('", "").replace("')).decode())", "")
        a = zlib.decompress(base64.b64decode(b)).decode()
        print(a)
    except:
        print(a)
        break